{"mac":"[
  {
    "key": "shift+space",
    "command": "editor.action.triggerSuggest",
    "when": "editorHasCompletionItemProvider && textInputFocus && !editorReadonly"
  },
  {
    "key": "ctrl+=",
    "command": "editor.fold",
    "when": "editorFocus"
  },
  {
    "key": "ctrl+-",
    "command": "editor.unfold",
    "when": "editorFocus"
  },
  {
    "key": "ctrl+alt+e",
    "command": "editor.action.peekDefinition",
    "when": "editorFocus"
  },
  {
    "key": "ctrl+alt+c",
    "command": "editor.action.peekImplementation",
    "when": "editorFocus"
  },
  {
    "key": "ctrl+shift+q",
    "command": "editor.action.showHover"
  },
  {
    "key": "ctrl+f",
    "command": "actions.find",
    "when": "editorFocus"
  },
  {
    "key": "shift+cmd+a",
    "command": "workbench.action.focusActiveEditorGroup"
  },
  {
    "key": "ctrl+shift+g",
    "command": "git-graph.view"
  },
  // SHOW QUICK DOCUMENTATION
  {
    "key": "ctrl+shift+q",
    "command": "editor.action.showHover",
    "when": "editorTextFocus"
  },
  // GO TO
  {
    "key": "ctrl+alt+e",
    "command": "editor.action.peekDefinition",
    "when": "editorHasDefinitionProvider && editorTextFocus && !isInEmbeddedEditor"
  },
  {
    "key": "ctrl+alt+i",
    "command": "editor.action.goToImplementation",
    "when": "editorHasDefinitionProvider && editorTextFocus && !isInEmbeddedEditor"
  },
  {
    "key": "shift shift",
    "command": "workbench.action.showAllSymbols"
  },
  // VSC
  {
    "key": "ctrl+k p",
    "command": "git.push"
  },
  // REMOVE PREV. SHORTCUT FOR DOCUMENTATION
  {
    "key": "ctrl+alt+l",
    "command": "editor.action.formatDocument",
    "when": "editorFocus"
  },
  {
    "key": "shift+cmd+t",
    "command": "-workbench.action.reopenClosedEditor"
  },
  {
    "key": "alt+f12",
    "command": "workbench.action.terminal.toggleTerminal"
  },
  {
    "key": "ctrl+`",
    "command": "-workbench.action.terminal.toggleTerminal"
  },
  {
    "key": "alt+p",
    "command": "editor.action.triggerParameterHints",
    "when": "editorFocus"
  },
  {
    "key": "alt+p",
    "command": "editor.action.triggerParameterHints",
    "when": "editorHasSignatureHelpProvider && editorTextFocus"
  },
  {
    "key": "ctrl+shift+j",
    "command": "workbench.action.toggleSidebarPosition",
    "when": "explorerViewletVisible && editorFocus || sideBarFocus"
  },
  {
    "key": "ctrl+shift+`",
    "command": "terminal.focus",
    "when": "terminal.visible"
  },
  {
    "key": "ctrl+shift+`",
    "command": "workbench.action.toggleSidebarVisibility",
    "when": "terminalFocus"
  },
  {
    "key": "ctrl+shift+e",
    "command": "workbench.action.focusActiveEditorGroup",
    "when": "!editorFocus"
  },
  {
    "key": "ctrl+alt+o",
    "command": "editor.action.organizeImports",
    "when": "editorFocus"
  },
  {
    "key": "cmd+k o",
    "command": "workbench.action.moveEditorToNewWindow",
    "when": "editorFocus"
  },
  {
    "key": "cmd+k o",
    "command": "-workbench.action.copyEditorToNewWindow",
    "when": "editorFocus"
  },
  {
    "key": "ctrl+h",
    "command": "workbench.action.toggleSidebarVisibility"
  },
  // REMOVE OLD KEYBINDINGS
  {
    "key": "shift+cmd+space",
    "command": "-editor.action.triggerParameterHints",
    "when": "editorHasSignatureHelpProvider && editorTextFocus"
  },
  {
    "key": "cmd+g",
    "command": "-editor.action.nextMatchFindAction",
    "when": "editorFocus"
  },
  {
    "key": "cmd+g",
    "command": "workbench.view.scm"
  },
  {
    "key": "ctrl+shift+g",
    "command": "-workbench.view.scm"
  },
  {
    "key": "cmd+g",
    "command": "-editor.action.nextMatchFindAction",
    "when": "editorFocus"
  },
  {
    "key": "f12",
    "command": "-editor.action.revealDefinition",
    "when": "editorHasDefinitionProvider && editorTextFocus && !isInEmbeddedEditor"
  },
  {
    "key": "ctrl++",
    "command": "-imagePreview.zoomIn"
  },
  {
    "key": "ctrl+-",
    "command": "-workbench.action.zoomOut"
  },
  {
    "key": "ctrl+shift+=",
    "command": "-imagePreview.zoomIn"
  },
  {
    "key": "cmd+k cmd+i",
    "command": "-editor.action.showHover",
    "when": "editorTextFocus"
  },
  {
    "key": "ctrl+[space]",
    "command": "-editor.action.triggerSuggest",
    "when": "editorHasCompletionItemProvider && textInputFocus && !editorReadonly"
  },
  // Disable closing window
  {
    "key": "ctrl+shift+w",
    "command": "-workbench.action.closeWindow"
  },
  {
    "key": "ctrl+alt+i",
    "command": "editor.action.revealDefinition"
  },
  {
    "key": "ctrl+[Slash]",
    "command": "editor.action.commentLine",
    "when": "editorTextFocus"
  },
  {
    "key": "ctrl+k t",
    "command": "workbench.action.tasks.runTask"
  },
  {
    "key": "ctrl+alt+-",
    "command": "workbench.action.navigateBackInNavigationLocations"
  },
  {
    "key": "ctrl+alt+=",
    "command": "workbench.action.navigateForwardInNavigationLocations"
  },
  {
    "key": "ctrl+k i",
    "command": "goimpl.ImplementInterfaceMethods",
    "when": "editorTextFocus"
  }
]"}
